from typing import List

def separate_paren_groups(paren_string: str) -> List[str]:
    result = []
    current_string = ""
    current_depth = 0

    for char in paren_string:
        if char == " ":
            continue

        if char == "(":
            current_depth += 1
            current_string += char
        elif char == ")":
            current_depth -= 1
            current_string += char

        if current_depth == 0:
            result.append(current_string)
            current_string = ""

    return result

