def order_by_points(nums):
    def digits_sum(num):
        sign = -1 if num < 0 else 1
        digits = [int(digit) for digit in str(abs(num))]
        return sum(digits) * sign

    return sorted(nums, key=digits_sum)

def specialFilter(nums):
    count = 0
    odd_digits = (1, 3, 5, 7, 9)

    for num in nums:
        if num > 10:
